import React from 'react';
import MyNavbar from '../components/MyNavbar';
import Product from '../components/Product';
import tommy from '../../img/tommy.JPG';
import wicho from '../../img/wicho.jpg';

const HomeView = () => {
    return (
        <div>
            <MyNavbar />
            <Product 
                pic={tommy} 
                name="Tomás González" 
                id="28.127.331"
                description="Born in Caracas but lived in Barquisimeto the most of his life. Loves soccer and recently started to watch MMA" 
            />
            <Product 
                pic={wicho} 
                name="Bernat Tagliaferro" 
                id="28.204.773"
                description="Born in Barquisimeto but lived in Barquisimeto the most of his life." 
            />
        </div>
    );
}
 
export default HomeView;
